import React from 'react'
import './Map.css'
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet'
import 'leaflet/dist/leaflet.css';
import { dronIcon } from './Icon'
import MarkerPlacement from './MarkerPlacement';


function Map() {
    return (

        <div className='map_main'>
            <MapContainer
                center={[52.232222, 21.008333]}
                zoom={12}
            >
                {/* <TileLayer
                    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                /> */}
                <TileLayer
                    layers='countries'
                    url='http://localhost:8080/geoserver/ne/wms?service=WMS&version=1.1.0&request=GetMap&layers=ne%3Acountries&bbox=-180.0%2C-90.0%2C180.0%2C83.64513&width=768&height=370&srs=EPSG%3A4326&styles=&format=application/openlayers'
                />

                <MarkerPlacement />

            </MapContainer>




        </div >
    )
}

export default Map
